import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Hello</p>
      </header>
      <form>
        <div className="form-group">
          <input
            className="form-control"
            type="text"
            placeholder="Type something"
            name="Name"
          />
        </div>
      </form>
    </div>
  );
}

export default App;
